import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { AuthService } from '../../auth.service';
import { environment } from '../../../environments/environment.development';
import { CookieService } from 'ngx-cookie-service';

@Component({
  selector: 'app-top-bar',
  templateUrl: './top-bar.component.html',
  styleUrls: ['./top-bar.component.css']
})

export class TopBarComponent {
  pauseState = false;
  languageArrowState = false;
  batteryPercentage = "%";

  constructor(private router: Router, private authService: AuthService, private cookieService: CookieService) {}

  clearCookies() {
    console.log("Cookies Cleared")
    this.cookieService.deleteAll()
  }

  pauseAndPlay() {
    this.pauseState = !this.pauseState;
  }

  languageChange() {
    this.languageArrowState = !this.languageArrowState;
  }

  logOut() {
    this.clearCookies()
    window.location.reload()
    this.router.navigate(['/login']);
    fetch(`http://${environment.API_URL}:${environment.PORT}/auth/logout`, {
      credentials: 'include',
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data.isCookieDeleted);
        if (data.isCookieDeleted) {
          this.authService.logout();
          this.router.navigate(['/login']);
        }
      })
      .catch((err) => console.log(err));
  }


  flags = [
    {
      order: 0,
      flagComp:'<svg width="25" height="25" viewBox="0 0 25 25" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><rect width="25" height="25" rx="3" fill="url(#pattern0_1329_33227)"/><defs><pattern id="pattern0_1329_33227" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image0_1329_33227" transform="scale(0.001)"/></pattern><image id="image0_1329_33227" width="1000" height="1000" xlink:href="data:image/png;base64,"/></defs></svg>',
      nameTag: 'ENG',
    },
    {
      order: 1,
      flagComp: '<svg width="25" height="25" viewBox="0 0 25 25" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><rect width="25" height="25" rx="3" fill="url(#pattern0_1329_33203)"/><defs><pattern id="pattern0_1329_33203" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image0_1329_33203" transform="translate(-0.28482 -0.283725) scale(0.00303951)"/></pattern><image id="image0_1329_33203" width="512" height="512" xlink:href="data:image/png;base64,"/></defs></svg>',
      nameTag: "HIN",
    },
    {
      order: 2,
      flagComp: '<svg width="25" height="25" viewBox="0 0 25 25" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><rect width="25" height="25" rx="3" fill="url(#pattern0_1329_33206)"/><defs><pattern id="pattern0_1329_33206" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image0_1329_33206" transform="scale(0.00195312)"/></pattern><image id="image0_1329_33206" width="512" height="512" xlink:href="data:image/png;base64,"/></defs></svg>',
      nameTag:"JAP",
    },
    {
      order: 3,
      flagComp: '<svg width="25" height="25" viewBox="0 0 25 25" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><rect width="25" height="25" rx="3" fill="url(#pattern0_1329_33225)"/><defs><pattern id="pattern0_1329_33225" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image0_1329_33225" transform="scale(0.00195312)"/></pattern><image id="image0_1329_33225" width="512" height="512" xlink:href="data:image/png;base64,"/></defs></svg>',
      nameTag:"FRA"
    }

  ]


  flagSvg = this.flags[0].flagComp
  flagName = this.flags[0].nameTag


  changeFlag(order:number) {
  this.flagSvg = this.flags[order].flagComp;
  this.flagName = this.flags[order].nameTag;
  this.languageChange();
  }
}
